import React from 'react';
import './navbar.css';
import { Link } from 'react-router-dom'; // Importer le composant Link de React Router
import Home from './Home';
import Tools from './Tools';
import Services from './Services';
import About from './About';
import Contact from './Contact';


function Navbare(){

    return(
        <div  data-aos="fade-up" className=' lg:mt-40'>
            <nav  className=' '>
                
                <div className=' '>
                    <div className='sm:w-13' tabIndex="0"> 
                    <Link to="./Home"  className=' ' data-feather="Projets">Home</Link>
                    </div>
                    <div className='sm:w-13' tabIndex="0"> 
                    <Link to="./Tools"  className=' ' data-feather="Projets">Mon mat√©riel</Link>
                    </div>
                    <div className='sm:w-13' tabIndex="0"> 
                    <Link to="./Services"  className=' ' data-feather="Projets">Services</Link>
                    </div>
                    <div className='sm:w-13' tabIndex="0"> 
                    <Link to="./About"  className=' ' data-feather="Projets">A propos</Link>
                    </div>
                    <div className='sm:w-13' tabIndex="0"> 
                    <Link to="./Contact"  className=' ' data-feather="Projets">Contact</Link>
                    </div>
                </div>
                
            </nav>
        </div>
        

    )
}
export default Navbare;
